    "preGame": "# üéôÔ∏è TUESDAY NIGHT TROLLBALL PRE-GAME REPORT! üéôÔ∏è\n\nHello there, sports-fiends and blood-letters! This is Nok the Corrupter coming to you live from the stone ramparts of the Stronghold Bailey! We‚Äôve got a real humdinger today as the popular New Ravenfall Commanders host the Oread's Summit Tamers in the final week of the season! The air is thick with anticipation and the scent of fermented fish‚Äîcourtesy of Theis Loredo‚Äôs pre-game snack ritual! üè∞üèüÔ∏è\n\nThe Commanders are looking to please their massive fanbase here in New Ravenfall, but the Tamers aren‚Äôt just here for the mountain scenery! I caught Swamy Ahasuerus dipping her hands in a bucket of ice-cold well water to numb the pain she's about to deliver! Meanwhile, Alwyn Wandy is over there whispering secret fears to the Trollball. I hope that ball likes horror stories, because it‚Äôs about to see some real terror on these cobblestones! ‚ùÑÔ∏èü™ì\n\nAnd don't forget, folks‚Äîit‚Äôs an **OPEN BAR** tonight! The ale is flowing faster than the blood, and that‚Äôs saying something in Osterra! Whether you're a fan of Sir Tanos and his Eponore bunch or you just like seeing people get clobbered, this is the place to be! The castle echo is going to make every bone-snap sound like a symphony! Let's get to the carnage! üç∫üíÄ",
    "postGame": "# üèÜ THE FINAL WHISTLE HAS BLOWN: TROLLBALL RECAP! üèÜ\n\nWhat a night of absolute mayhem at the Stronghold Bailey! The cobblestones are slick with more than just spilled mead, and the castle walls are still ringing from the impact of armored bodies hitting the ground! It was a defensive masterclass and a brutal display of mountain-man strength as the Tamers silenced the Ravenfall crowd! üè∞ü©∏\n\nThe action started fast with Saloma Talich snatching the Trollball in Center Field, dodging Theis Loredo like a demon escaping a priest! The Commanders tried to set the tone early with their physical play, but the Tamers' front line held firm against the initial surge of the Eponore-backed favorites.\n\nThen came the first real taste of blood! Jozef Pepe, wielding a Zweihander with the grace of a falling boulder, absolutely leveled Clippard Burr! The injury was magnificent‚ÄîBurr went down and didn't get back up until the healers intervened. That's the kind of spirit we like to see in the final week! ‚öîÔ∏èüí•\n\nBut the Tamers wouldn't be bullied in the Stronghold! Kass Fogel took offense to the roughhousing and delivered a retaliatory strike that sent Rhett Gavrilla straight to the infirmary! Not to be outdone, the Commanders' Estes Adrian cracked Odericus Juxon‚Äôs helmet right open. It was a glorious exchange of hospital passes and heavy metal! üè•üî®\n\nBy halftime, the **Open Bar** was clearly the most popular player on the field! While most of these 'heroes' were starting to sway like wheat in a storm, I noticed Jozef Pepe and Dric Trilley were still standing straight. A impressive display of alcohol tolerance, or perhaps they‚Äôre just too stubborn to admit they‚Äôre seeing double! üç∫ü•¥\n\nThe silence of the home crowd was deafening when the highlight of the night occurred! Alwyn Wandy, perhaps fueled by those whispered fears, lined up a shot from Center Field. With a heave that would make a giant weep, the ball sailed through the goal! **TWO POINTS** for the Oread's Summit Tamers! üéØüî•\n\nThe Commanders tried to claw back, but the second half was a graveyard of dreams. Dusa Curson managed to knock Kass Fogel out of the game, but the Tamers' defense was an iron wall. Dric Trilley returned the favor by sending Jozef Pepe to the dirt with a thunderous tackle that likely shook the Governor-King Zenku‚Äôs throne! üëëüìâ\n\nOne of the most embarrassing moments for the home team came when Croteau Osmo tried a desperate pass, only for it to be snatched right out of the air by Swamy Ahasuerus! Swamy‚Äôs ice-cold hands didn't fumble that one, effectively killing any hope of a Ravenfall comeback. üëêüèà\n\nAs the clock wound down, Edme Virgil continued the assault, putting Theis Loredo on the injury list with a nasty War Pick strike. Even as Jozef Pepe tried one last-ditch effort to break Swamy Ahasuerus, the Tamers simply laughed in the face of the Commanders' fading glory. üèîÔ∏èüí™\n\nFinal Score: **The Oread's Summit Tamers 2, The New Ravenfall Commanders 0!** A total shut-out! The popular crowd is heading home disappointed, much like Sir Artorias when he realizes his fey friends can't save him from a good old-fashioned mountain beating! Stay tuned for the playoffs, sports fans‚Äîit‚Äôs only going to get bloodier from here! üéôÔ∏èüëπ",
