    "preGame": "Step right up, sports fans, ghouls, and battle-hardened veterans! It is a glorious, salt-crusted Tuesday evening here at the Cliffside Pitch in Southport, and boy, do we have a doozy for the final week of the season! I am Nok the Corrupter, coming to you live where the gale-force winds are currently trying to whistle a tune through my ribs, and the sea spray is giving the Trollball a lovely, slippery sheen! We are perched right on the edge of oblivion, folks‚Äîone bad step and you are shark bait! It is the Brimstone Fire Eaters taking on our hosts, the Southport Narwhals, in a match that promises more broken bones than a necromancer's workshop!\n\nNow, look at these Fire Eaters! They hail from the Su'akour Bowl, and you can tell by the way Glassman Solley is currently washing his hands with dirt‚Äîa classic ritual for a man who loves a Rondel Dagger and a face full of grime! Meanwhile, Nachison Icken has her boots on the wrong feet for the warm-up! That is the kind of chaotic energy that would make even my old pal Sir Tanos blush, and we all know that man hates a letter but loves a good stabbing! The Fire Eaters are looking to burn down the house, and I for one am rooting for the team that brings the most heat to this freezing cliffside!\n\nBut don't count out King Nezmear‚Äôs favorites just yet! The Southport Narwhals are looking sharp, literally! Loralyn Lyndy is over there adjusting her codpiece with the kind of theatrical importance you usually only see at a God-King Artorias coronation! And keep an eye on Cilurzo Sochor, who is currently whispering a heroic backstory to the leather troll head. I hope that head likes tragedy, because it is about to be punted into a basket! The fans might be a bit sparse today‚ÄîI suppose everyone is home tending to their werewolves or feeding Elizabeef the werecow‚Äîbut the atmosphere is electric with the threat of imminent injury!\n\nThere is no open bar today, folks, which is a crying shame for those of us who like our violence with a side of rotgut, but the players are sober and ready to slaughter! Will the Fire Eaters‚Äô voodoo weather rhymes from Nigel Rothmuller carry them to victory, or will the Narwhals use those rocky outcroppings to cheese a win? It is the last stop before the playoffs, and the Everwar is heating up! Strap in, keep your shields up, and let‚Äôs get this Trollball rolling! It‚Äôs going to be a real humdinger of a homicide!",
    "postGame": "Hey-ho, what a display of athletic carnage! The whistle has blown, the spray has settled, and the Southport Narwhals have defended their cliffside with the ferocity of a cornered crab! The final score stands at Narwhals 2, Fire Eaters 0, and my horns are still buzzing from the sheer impact of those collisions! It was a masterclass in linear brutality, and while my favorites from the Fire Eaters couldn't find the basket, they certainly found plenty of bruises to take home as souvenirs!\n\nThe action kicked off with Loralyn Lyndy snagging the ball in Center Field, and from that moment, the Narwhals were moving like a greased lightning bolt! Braden Gaile made a dash for the goal that would have made even the circus-escapee Sawyer jealous, but the Fire Eaters‚Äô defense held firm for a moment. However, the Narwhals‚Äô persistence paid off when Blanc Fantasia‚Äîa man who clearly knows his way around a Seax‚Äîlooted a pass over to Cibis Areta. Cibis didn't hesitate, dunking that troll head into the goal like it was a naughty goblin! 1-0 for the home team, and the wind howled in approval!\n\nBut the real story of the first half was the absolute wreckage in the trenches! Malcolm Goer decided that Nigel Rothmuller‚Äôs ribs were surplus to requirements, delivering a tackle that left the spear-wielder seeing stars and visiting the healer! And oh, the beauty of the violence didn't stop there! Fineman Dolhenty went on a absolute rampage, knocking Orlina Jerrine and Selimah Tully right out of their boots! It was a symphony of agony that would have brought a tear to Lord Orzalon's eye if he weren't currently cooling his heels in prison! The Fire Eaters were dropping like flies, folks!\n\nJust when you thought the Fire Eaters might mount a comeback, Loralyn Lyndy showed off some of that 'codpiece confidence' by intercepting a wild pass from Campball Fink! It was a theft so brazen it would make the Guild of the Black Sky proud. Despite the noxious fumes and the slippery sea spray, the Narwhals kept their composure. Even with the lack of alcohol, the players were stumbling around like they‚Äôd spent the night at one of Imra‚Äôs dust-heavy parties, thanks to the relentless wind and the pounding they were taking!\n\nHalftime came just in time for Raphael Miyasawa to kiss a few more biceps and get the Fire Eaters back on their feet. But the second half was more of the same Southport dominance! Cilurzo Sochor might have dropped the ball once or twice, probably busy narrating the troll head's internal monologue, but the Narwhals didn't let up. Malcolm Goer continued to be a one-man wrecking crew, clearing a path through the dirt-stained Fire Eaters like a plow through a graveyard!\n\nThe nail in the coffin came when Blanc Fantasia, showing the kind of grace Sir Artorias usually reserves for fey-slaying, found Cibis Areta once again in the End Zone! Another dunk, another point, and the Narwhals were sitting pretty at 2-0! The Fire Eaters tried to retaliate, with Wylde Jutta delivering a bone-crunching tackle to Crescint Sonia that sent the Warhammer-wielder to the sidelines, but it was too little, too late. The Brimstone boys just couldn't find the range on their shots, with Bollinger Susette missing a long-distance prayer that sailed wide enough to hit a passing seagull!\n\nBy the closing minutes, the field was a mess of salt, sweat, and shattered dreams. Cibis Areta, not content with scoring, decided to add 'injury to insult' by flattening Lowson Hersh. And just to put a bow on it, Fineman Dolhenty ended the game by taking out Wylde Jutta! It was a bloodbath, pure and simple! The Narwhals played like they had the goddess Oona herself cheering from the lighthouse, while the Fire Eaters looked like they‚Äôd spent too much time communicating with birds and not enough time catching the ball!\n\nSo, as the sun dips below the horizon and the werewolves of Southport start their nightly choir, we wrap up the regular season! The Narwhals take the win, the Fire Eaters take the bandages, and we all take a moment to appreciate the glorious lack of sportsmanship! My heart sinks for the Brimstone crew, but you can't win 'em all when you're wearing your boots on the wrong feet, can you?\n\nTake heart, Eponore fans, there is always the playoffs to look forward to! Perhaps Sir Tanos will stop stabbing me long enough to give the team a pep talk. But for now, the Narwhals are the kings of the cliff! This is Nok the Corrupter, signing off from the most dangerous linear field in Osterra! Keep your blades sharp and your healers closer!\n\nFinal Score: The Southport Narwhals 2 - The Brimstone Fire Eaters 0. What a day for a murder, stay tuned for the playoffs, folks! It‚Äôs going to be absolutely demonic!",
