    "postGame": "What a crackerjack of an afternoon of absolute mayhem! The Prismatic Pavilion nearly collapsed under the weight of all that beautiful violence! The Bizarres started things off with a bang when Willa Lois took a shot from center field and sent that trollhead sailing right through the hoop for two points! üéØ It looked like the flashy performers of the circus had the upper hand, but the Onslaught isn't a team that stays down for long! The violence really ramped up when Willa Lois absolutely crunched Abner Seidel, sending him to the healer with a nasty injury! üöë And just to keep the blood flowing, Gagliano Tallbott took out Wynnie Faina right before the break! But don't you worry, fans, Ema Ulrick was there to clean up the mess, dunking the ball twice in the first half to keep the Onslaught in the hunt! ü©∏ \n\nHalftime saw everyone get patched up by the healers, including Ahron Latashia who I‚Äôm sure was just drawing more circles in the dirt! When we came back, it was the Millham Evangeline show! Millham stepped up to center field and hammered home a two-point shoot that had the crowd roaring! üì£ The Bizarres tried to make a comeback when Melesa Zelten danced through the defense for a dunk, but the shifting terrain of this pavilion is a cruel mistress! I saw Gagliano Tallbott running like the wind, only for the defense to shut him down! üé≠ The drama peaked when Wynnie Faina got some revenge, tackling Aggri Cookie so hard I think I saw a few teeth fly into the lagoon! ü¶∑ Millham Evangeline wasn't finished, though, sinking another magnificent two-point shot from Away 2-Point to put the nail in the coffin! Final score: Oak & Onslaught 6, Starlight Bazaar Bizarres 3! üèÜ \n\nA dominant victory for the Warden‚Äôs finest, even if Sir Randy‚Äôs presence in the stands makes my skin crawl! I‚Äôd much rather be watching my Ebon Gate Corruptors tear the Haven Lights limb from limb, but this was a decent substitute for a Tuesday night! The Bizarres might have the flair, but today they just had the floor‚Äîmostly because they were being pinned to it by a mallet or a blackjack! The crowd for the Onslaught is absolutely electric tonight, cheering every broken bone like it was a gold coin! It‚Äôs a shame the Bizarres couldn't find their footing on these unstable planks, but that's Trollball for you‚Äîone minute you're posing, the next you're floating in the lagoon! This is Nok the Corrupter, signing off from the most beautiful bloodbath in Osterra! See you at the playoffs, if you survive the night! üòàüî•",
