    "preGame": "# üèüÔ∏è WELCOME TO THE BUCCANEER'S BOWL! üèüÔ∏è\n\nGreetings, boils and ghouls! Nok the Corrupter here, coming to you live from the sun-drenched, blindingly bright Buccaneer's Bowl at the Toast Island Resort! We're in the final week of the season, folks, and the tension is thicker than a swamp hag's stew! On one side of the line, we've got **The Greenwatch**, those nature-loving Wardens who probably spend more time hugging trees than hitting people! I saw Madea Mensch hopping to the line with his laces tied together‚Äîtalk about a handicap! And look at Nariko Javed wiggling those fingers; if that's magic, I'm a paladin! It's enough to make a demon weep with boredom!\n\nOver in the home dugout, **The Tortell Privateers** are looking lean, mean, and ready to pillage! Lilithe Royce is currently sticking leeches to her legs to 'lighten her step'‚Äînow that's the kind of bloodletting I love to see! üíâ Dib Tufts just downed a raw egg, shell and all, a real breakfast of champions! While Elspeth Ortell might be mixing up some of her 'ritual sangria' for the resort guests, these Privateers are thirsty for something much redder! Even that puppet kraken in the bay looks intimidated by the violence about to unfold!\n\nThis stadium is a real piece of work, isn't it? Imported turf and 'Resort Security'‚ÄîI'd like to see those rent-a-cops try to stop a rampaging troll! With the playoffs looming, both teams are fighting for a spot in the history books of Osterra. Will the Greenwatch's 'Ritual Focus' save them, or will they be blinded by the sun and the sheer brilliance of the Privateers? Let's get this carnage started! üèàüíÄ",
    "postGame": "# üè¥‚Äç‚ò†Ô∏è THE PRIVATEERS PLUNDER A VICTORY! üè¥‚Äç‚ò†Ô∏è\n\nWhat a finish, folks! What a beautiful, brutal display of Trollball here at the Buccaneer's Bowl! The Tortell Privateers have sailed away with a 6 to 4 victory over the Greenwatch in a match that went all the way to a heart-stopping overtime! It was a real barn-burner, or should I say, a ship-sinker! üö¢üí•\n\nThe game kicked off with a flurry of activity in the Away Field! Castorina Gies snatched up the troll head like a pirate claiming buried treasure! Payson Jan tried a wild pass that went nowhere‚Äîprobably too much of Elspeth's sangria‚Äîbut Melisande Eustacia was there to clean up the mess and keep the Privateers' momentum alive! The Greenwatch players looked like they were still trying to communicate with the birds!\n\nThe defense for the Greenwatch was looking stout early on, with Darin Berliner putting on a theatrical display of aggression, blocking Dib Tufts and Kidder Starkey with the flair of a stage actor! I haven't seen that much posturing since Sir Artorias last looked in a mirror! But Loralee Sunny wouldn't be denied, charging toward the goal with her war scythe glinting in that blinding resort sun!\n\nThe highlight of the first half had to be Keisling Damalas! He lined up from the 2-point zone and let it rip! üéØ Splash! Two points for the Privateers! He didn't stop there, immediately diving back into center field to reclaim possession! That's the kind of initiative that makes a demon proud! Keisling was playing like he had the luck of the Abyss on his side!\n\nThe Greenwatch tried to fight back, with Rese Halpern grabbing the ball and Drona Jacklin making a desperate run for the goal, but the Privateers' defense was like a stone wall! Even Troy Jorgan's attempts to advance were shut down faster than a Haven Lights prayer meeting! Those 'heroes' from the Wardens were looking more like 'zeros' out there on the sand!\n\nThen came the real fireworks! Lilithe Royce, probably powered by those leg leeches, absolutely leveled Madea Mensch! ü¶µüí• The crack of bone echoed across the imported turf as Madea was sent to the infirmary! It was a masterpiece of violence that would make even Sir Randy's fancy bow snap in half with envy! Madea's ritual of tying his laces together clearly didn't help him stay on his feet!\n\nNot to be outdone, Dib Tufts decided to leave his mark before the whistle! He lunged at Verne Methuselah and delivered a tackle so ferocious it left Verne seeing stars and nursing a one-way ticket to the healer's tent! üè• That's how you play the game, folks! No mercy, no prisoners! If the ball carrier is breathing, you aren't hitting hard enough!\n\nWe headed into overtime tied up, and the atmosphere was electric! Both teams got their wounded back, thanks to the tireless work of Nariko and Eugen, but the exhaustion was showing! Melisande Eustacia secured the ball early in the extra period, setting the stage for the final act while the resort guests watched in slack-jawed horror! üçπüòµ\n\nThere was one last gasp of defiance from the Greenwatch! Troy Jorgan finally got his hands on Dib Tufts and sent him packing with a brutal injury of his own! Revenge is a dish best served on a Trollball field, even if it came a little too late to save the match! It's just a shame it wasn't a member of the Haven Lights on the receiving end!\n\nThe end came when Payson Jan took aim from the Home Field and hammered home the winning score! The crowd of distracted tourists actually stopped looking at the puppet kraken for five seconds to cheer! üêô The Greenwatch are headed back to the woods with nothing but bruises, while the Privateers are celebrating a hard-earned win with some high-quality plunder!\n\nIn the end, the Wardens just couldn't handle the heat! Maybe if Sir Randy spent less time polishing his 'fancy' equipment and more time teaching his squad how to take a hit, they'd be heading into the playoffs with more than just sore heads! This is Nok the Corrupter, signing off from the Buccaneer's Bowl! Stay nasty, Osterra! üòàüèà",
