    "preGame": "### üéôÔ∏è HELLO OUT THERE IN RADIOLAND! TUNE YOUR DIALS TO TUESDAY NIGHT TROLLBALL! üéôÔ∏è\n\nBoy howdy, folks, have we got a real humdinger for you today! It‚Äôs the final week of the regular season on the plane of Osterra, and the air is thick with the smell of sweat, ozone, and‚Äîif my nostrils don't deceive me‚Äîfreshly tilled dirt! We are coming to you live from **The Hollow Mine** in Wyrmwood Hollow, where the ground is literally humming with energy! I haven't felt a buzz like this since Morgwae and Artorias busted me out of the Demon Prison to save that grumpy Sir Tanos! The vines are tangling, the mine draft is chilling, and the violence is about to be THRILLING!\n\nToday, my absolute favorites, the **Ebon Gate Corruptors**, are looking to soil the reputation of the **Wyrmwood Stronghammers**! I saw Bullion Iglesias back in the locker room, meditating so silently you could hear a flea sneeze‚Äîhe‚Äôs got that killer focus! Meanwhile, over in the home dugout, Godart Urissa is insisting on wearing an oversized, floppy hat during warm-ups. It‚Äôs a fashion choice that would make even the high-and-mighty Count Trez Arrigo blush, but in this league, it‚Äôs all about the hits, not the hats! \n\nWe‚Äôve got a stadium full of fans‚Äîmostly Grove types, probably hoping for a 'clean' game. HA! Not on my watch! The Corruptors are ready to leave a mark, and I don't mean an autograph. Terle Chenay is leading the Corruptors out after a locker room belching contest that nearly shook the stands! Will the Stronghammers' 'Humming Earth' be enough to stop the impending corruption? Or will the vines of Wyrmwood be the only thing left standing? Grab your favorite beverage and don't blink, because this is Trollball, where the only thing that regenerates faster than the players is the excitement! üèàüíÄ‚ö°",
    "postGame": "### üèüÔ∏è WHAT A SPECTACLE OF SPLATTER! THE SEASON FINALE IS IN THE BOOKS! üèüÔ∏è\n\nHoly cow, fans! If you didn't enjoy that, you don't have a pulse‚Äîand in this realm, that's saying something! It was a back-and-forth slugfest that saw more blood than a butcher's apron! My beloved Ebon Gate Corruptors came out swinging, with Ellette Paz snatching up the troll head like a hungry demon at a banquet! They didn't waste any time, as **Simsar Carrelli** lined up a shot from Center Field and zipped it right through the goal for an early 2-0 lead! The Corruptors were firing on all cylinders, just the way I like it!\n\nBut oh, the brutality didn't stop there! Calvinna Isador of the Stronghammers decided to get personal, tackling Smith Syst so hard the healer had to be called in! But you can't keep a good Corruptor down! As Utter immediately retaliated, flattening Isador into the humming earth! It was a symphony of crunching bones that would have made Geth the Gravelord weep with joy! The first half was a whirlwind of missed passes and broken bodies, leading us into a halftime break where the healers definitely earned their keep.\n\nAfter the break, the Stronghammers seemed to find their footing in those tangled vines. Cornela Piscatelli‚Äîwho, I might add, spent pre-game braiding a teammate's nose hair‚Äîturned that focus into a devastating tackle on Ahasuerus An! The momentum shifted like a landslide in the mine! **Ultun Barthelemy** found an opening from the Home Field and let fly a shot that tied the game up! My heart nearly stopped, and I don't even need one!\n\nThen came the heartbreak for the Ebon Gate faithful. Bullion Iglesias, usually so reliable, threw a wild pass that was snagged right out of the air by Rebane Kendy! The interception of the century! The Stronghammers were on the move, and despite Judi Carrington's best efforts to turn Calvinna Isador into a permanent fixture of the turf, the defense couldn't hold. **Sabian Gleason** broke through the line, clambered into the End Zone, and slammed that troll head home for a touchdown! üèÜ\n\nThe Corruptors tried for a desperate late-game surge with Simsar Carrelli, but the clock and the Stronghammer defense were just too much. The home crowd‚Äîall those Grove-loving leaf-munchers‚Äîwent wild! I‚Äôm sure High Priestess Oona is somewhere smiling, which is enough to make a demon want to vomit. \n\nFinal Score from the Hollow Mine: **The Wyrmwood Stronghammers 3, The Ebon Gate Corruptors 2.**\n\nIt‚Äôs a tough pill to swallow for the Ebon Gate boys. They played with the kind of malice that usually earns you a promotion in the Demon Prison! But the Stronghammers used every bit of that mine draft and humming earth to their advantage. \n\nLet's talk about those 'heroes' for a second. While guys like Sir Tanos are out there stabbing things and being 'bold,' these players are out here actually working for a living‚Äîmostly by hitting each other with maces and axes! It's a shame the Corruptors couldn't close it out, but that's the beauty of the sport. One minute you're the hammer, the next you're the troll head! \n\nThe stadium was a factor all night. Those tangled vines caught more players than the actual defenders did! I saw Napoleon Anzovin thanking his armor after a particularly nasty spill, and he's going to need a lot more than armor to recover from this one. The Stronghammers might have the win, but they're going to be feeling those Corruptor bruises well into the playoffs!\n\nDon't let the loss get you down, Corruptor fans! We're headed into the post-season, and if there's one thing I know about Ebon Gate, it's that they always come back nastier than before! They'll be polishing their boots with bacon grease and dreaming of revenge! \n\nWhat a way to end the regular season! We saw interceptions, we saw dunked heads, and we saw enough injuries to fill a dozen regeneration pits! This is Nok the Corrupter signing off from the booth. Remember: in life, you win some and you lose some, but in Trollball, everyone gets hit! Goodnight, Osterra! üéôÔ∏èüëπüèà",
